function any (...args) {
  const options = args.pop();

  if (!args.length) {
    throw new Error('Handlebars Helper "any" needs 1 parameter');
  }

  let input;
  if (args.length > 1) {
    input = args;
  } else {
    input = arrayify(args[0]);
  }

  let result = false;
  for (const value of input) {
    if (truthy(value)) {
      result = value;
      break;
    }
  }

  if (!options.fn) return result || '';

  return result ? options.fn(this) : options.inverse(this);
};

}

