function content (...args) {
  if (args.length === 1) {
    throw new Error('Handlebars Helper "content" needs 1 parameter');
  }

  const options = args.pop();
  const name = args[0];

  this._blocks = this._blocks || {};

  this._blocks[name] = {
    mode: args[1] || 'replace',
    fn: options.fn,
  };
};

function date (...args) {
  const options = args.pop();
  let format, input;

  switch (args.length) {
  case 0:
    format = 'yyyy-MM-dd HH:mm:ss';
    input = new Date();
    break;
  case 1:
    format = args[0];
    input = new Date();
    break;
  case 2:
    var parsePattern = options.hash && options.hash.parse;
    if (parsePattern) {
      input = parse(args[0], parsePattern, new Date());
    } else {
      input = new Date(args[0]);
    }
    format = args[1];
    break;
  default:
    return '';
  }

  if (!isValid(input)) {
    // console.trace('Invalid input for Handlebars Helper "date"', { input, ...options.hash }); // eslint-disable-line
    return '';
  }

  return dateFormat(input, format);
};

}

