  const [ haystack, needle ] = args;
  let result;

  if (isArray(haystack)) {
    result = haystack[haystack.length - 1] === needle;
  } else if (isString(haystack)) {
    result = haystack.endsWith(needle);
  } else {
    result = false;
  }

  if (!options.fn) {
    return result || '';
  }

  return result ? options.fn(this) : options.inverse(this);
};

}

