function random (min, max) {
  switch (arguments.length) {
  case 1:
    return Math.random();
  case 2:
    if (min > 0) {
      max = min;
      min = 0;
    } else {
      max = 0;
    }
    break;
  default:
    // do nothing
  }

  if (max === min) return max; // no need to do that math

  return Math.floor((Math.random() * (max - min )) + min);
};

